import React from "react";
import styled from "styled-components";
import MapAPI from "./MapAPI";

const FotterContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 500px;
  background: #495057;
  border-top-right-radius: 4px;
  border-top-left-radius: 4px;
`;

const ContactContainer = styled.div`
  width: 500px;
  h1 {
    margin-bottom: 0.5rem;
  }
`;

const ContactForm = styled.form`
  display: flex;
  width: 350px;
  height: 268px;
  background: white;
  padding: 1rem;
  border-radius: 6px;
`;

const CustomInput = styled.input`
  width: 150px;
  height: 30px;
  outline: none;
  border: 2px solid #63e6be;
  border-radius: 4px;
  font-size: 1.25rem;
  padding-left: 1rem;
`;

const Fotter = () => {
  return (
    <FotterContainer>
      <MapAPI />
      <ContactContainer>
        <h1>asd</h1>
        <ContactForm>
          <CustomInput type="text" placeholder="Name" />
          <CustomInput type="text" placeholder="Email" />
        </ContactForm>
      </ContactContainer>
    </FotterContainer>
  );
};

export default Fotter;
